<p>Металлоконструкции круглой формы из гофрированного стального листа обладают оптимальными характеристиками для применения в дорожном и гражданском строительстве. Используют трубы серии МГК круглые для оборудования водоотводных систем, дренажных сетей, тоннелей под землей. Конструкции 130х32,5 мм обладают сравнительно небольшой высотой гофра и шагом, что ограничивает их применение в тоннелях и водостоках условным проходом 0,8–3,5 м. Толщина стенки до 4 мм обеспечивает достаточную прочность под насыпями любой высоты под дорогами с высокой пропускной способностью.</p>
<p>Трубы 130х31 мм отличаются простотой транспортировки и монтажа, невысокой требовательностью к качеству грунтовой обоймы, обладая оптимальным соотношением полезной площади и прочности.</p>
